import React, { Component } from 'react';
class DocumentSection extends Component {
    render() { 
        return (  
            <div className="d-block" style={{marginTop : '3%'}}>
                <p className="h4 mb-2 text-dark text-center border-bottom">{this.props.name}</p>
                <img className="d-inline-block border border-info" alt="pdf preview" style ={imageStyle} src={pdfImg}></img>
                <img className="d-inline-block border border-info" style ={imageStyle} src={teamLogoImg}></img>
                <img className="d-inline-block border border-info" style ={imageStyle} src={teamLogoImg}></img>
                <img className="d-inline-block border border-info" style ={imageStyle} src={teamLogoImg}></img>
                <img className="d-inline-block border border-info" style ={imageStyle} src={teamLogoImg}></img>
                <img className="d-inline-block border border-info" style ={imageStyle} src={teamLogoImg}></img>
            </div>
        );
    }
}
const containerStyle = {
    paddingRight : '15%',
    paddingLeft : '15%'
};
const imageStyle = {
    marginTop : "5px",
    marginLeft : "3%",
    width : "13%",
    height : "13%"
};
const pdfImg = require('../Resources/pdf.jpg');
export default DocumentSection
